package collection;

import java.util.LinkedHashSet;

public class LinkedHashSetExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		LinkedHashSet lhs = new LinkedHashSet();
		lhs.add(30);
		lhs.add("Ram");
		lhs.add(55);
		lhs.add(78);
		System.out.println(lhs);

	}

}
